import React, { Component } from 'react'
import {Card, Button, Row, Col} from 'react-bootstrap'


export default class CardsProjects extends Component {
    render() {
      console.log('here');

        return (
            <Col sm={6} style={{padding: '5px'}}>
            <Card className="bg-dark text-white" >
              <Card.Img width src="https://placehold.it/1920x1080" alt="Card image" />
              <Card.ImgOverlay className='details'>
              <Card.Title className="text-center">Card title</Card.Title>
                <Card.Text className="text-center">
                  This is a wider card with supporting text below as a natural lead-in to
                  additional content. This content is a little bit longer.
                </Card.Text>
                <Card.Text className="text-center"> Last updated 3 mins ago</Card.Text>
              </Card.ImgOverlay>
            </Card>
            {/* this is  */}
            </Col>
        )
    }
}
